import React from 'react';
import './footer.css';

const Footer = () => {
  return (
      <div className='footer-full'>
  <div className='container'>
      <div className='footer-content'>
          <div className='about_link'>
              <div>About Us</div>
              <p>We at DeepValley are a modern Energy provider community that provides all type of energy solution.</p>
          </div>
          <div className='connect_link'>
              <div>Contact Us</div>
              <p>India</p>
          </div>
      </div>
  </div>
  </div>
  );
};

export default Footer;
